import React, { useState } from 'react';

const ExaManageAddPage = () => {
  const [userName, setUserName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [type, setType] = useState('1'); // Default value for the dropdown is '1'

  const handleSubmit = () => {
    // Your logic to handle form submission goes here
    // You can access all the form values from the state variables
    // For example: userName, email, password, type, etc.
    console.log('Form submitted!');
  };

  const handleCancel = () => {
    // Your logic to handle form cancel goes here
    // For example: clear the input fields or navigate back
    console.log('Form canceled!');
  };

  return (
    <div>
      <div>
        <label>User Name:</label>
        <input type="text" value={userName} onChange={(e) => setUserName(e.target.value)} />
      </div>
      <div>
        <label>Email:</label>
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </div>
      <div>
        <label>Password:</label>
        <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
      </div>
      <div>
        <label>Type:</label>
        <select value={type} onChange={(e) => setType(e.target.value)}>
          <option value="1">1</option>
          <option value="2">2</option>
        </select>
      </div>

      <div>
        <button onClick={handleCancel}>Cancel</button>
        <button onClick={handleSubmit}>Submit</button>
      </div>
    </div>
  );
};

export default ExaManageAddPage;
